import { Form, Modal } from "react-bootstrap";

function Signup(){
    return (
        <>
        <Form>
            <Form.Group>
                <Form.Control type='email' placeholder="example@domain.com" variant='outlined'></Form.Control>
            </Form.Group>
        </Form>     
        </>
    );
}

export default Signup;
